df = pd.DataFrame(data)


st.title("Employee Data Dashboard")

# --- Section 1: Filter by Emp Code or Employee Name ---
selection_option = st.radio("Choose to select by:", ('Emp Code', 'Employee Name'))
st.write(f"Selected filter option: {selection_option}")

if selection_option == 'Emp Code':
    emp_code = st.selectbox("Select Emp Code", df['Emp Code'].unique())
    selected_data = df[df['Emp Code'] == emp_code]
else:
    emp_name = st.selectbox("Select Employee Name", df['Employee Name'].unique())
    selected_data = df[df['Employee Name'] == emp_name]

# Display result from Emp Code / Name filter
if not selected_data.empty:
    st.write("Filtered Employee Data:")
    st.dataframe(selected_data, use_container_width=True)
else:
    st.write("No employee data selected.")

# --- Section 2: Filter by Department ---
st.markdown("---")
st.subheader("View All Employees by Department")

dept_selected = st.selectbox("Select Department", sorted(df['Department'].unique()))
dept_data = df[df['Department'] == dept_selected]

if not dept_data.empty:
    st.write(f"Employees in Department: {dept_selected}")
    st.dataframe(dept_data, use_container_width=True)
else:
    st.write("No data available for selected department.")
